import './ExpenseItem.css';

function ExpenseItem() {

    const ExpenseDate = new Date(2022, 7, 22);
    const ExpenseName = "Electricity Bill";
    const ExpenseAmt = 999.00;

    return (
        <div className="expense-item">
            <div >June 22nd, 2022</div>
            <div className="expense-item__description">
                <h2>{ExpenseName}</h2>
                <div className="expense-item__price">Rs. {ExpenseAmt}</div>
            </div>
        </div>
    );
}

export default ExpenseItem;
